%[text] # 例1.13（復元処理）
%[text] 村松正吾　「多次元信号・画像処理の基礎と展開」
%[text] 動作確認： MATLAB R2025b
%[text] ## 準備
isVerbose = false;
prj = matlab.project.currentProject;
prjroot = prj.RootFolder;
datfolder = fullfile(prjroot,"data");
resfolder = fullfile(prjroot,"results");
myfilename = "example01_13"; % mfilename

imgname = "msipimg08";
imgfmt = "tiff";
%%
%[text] ## 画像データの読込
imgfile = fullfile(datfolder,imgname);
X = im2double(rgb2gray(imread(imgfile,imgfmt)));
%%
%[text] ## 劣化前の画像表示
figure(1) %[output:9ad54ab8]
imshow(X) %[output:9ad54ab8]
title('原画像') %[output:9ad54ab8]
%%
%[text] ## 劣化過程
hsigma  = 4;                    % ガウスカーネル分散
hsize   = 2*ceil(2*hsigma)+1;   % ガウスカーネルサイズ
nvar    = (10/255)^2;            % 加法性白色ガウスノイズ分散
gaussfilt = fspecial('gaussian',hsize,hsigma);             % ガウスカーネル
linproc = @(x) imfilter(x,gaussfilt,'conv','circular'); % 線形観測過程
U = linproc(X);                 % 線形観測
V = imnoise(U,'gaussian',0,nvar);  % 加法性白色ガウスノイズ
%%
%[text] ## 劣化後の画像表示
figure(2) %[output:54a3937b]
imshow(V) %[output:54a3937b]
title('劣化画像') %[output:54a3937b]
%%
%[text] ## 劣化後の品質
fprintf('劣化後の品質(PSNR)： %6.2f [dB]\n',psnr(V,X)) %[output:2416cd90]
%%
%[text] ## 復元前処理
adjproc = @(x) imfilter(x,gaussfilt,'corr','circular'); %　随伴観測過程
vpst = rand(size(V),'like',V);
lpre = 1.0;
err_ = Inf;
while ( err_ >  1e-5 ) % べき乗法
    % vpst = (P.'*P)*vupre
    vpre = vpst/norm(vpst(:));
    u    = linproc(vpre); % P
    vpst = adjproc(u);    % P.'
    n    = (vpst(:).'*vpst(:));
    d    = (vpst(:).'*vpre(:));
    lpst = n/d;
    err_ = norm(lpst-lpre);
    lpre = lpst;
end
frameBound = 1; % フレーム境界
L = frameBound*lpst ;  
%fprintf('L = %g\n',L);
%%
%[text] ## **復元処理(FISTA)**
lambda  = 5e-4;
nLevels = 5;
nItrs   = 50;
isFista = true;
%
[Cpre,S]= msip.udhaarwtdec2(adjproc(V),nLevels);
tpre = 1;
%
Y = msip.udhaarwtrec2(Cpre,S);
R = linproc(Y)-V;
for iItr = 1:nItrs
    D = (1/L)*msip.udhaarwtdec2(adjproc(R),nLevels);
    C = softthresh(Cpre-D,lambda/L);
    if isFista % FISTA
        W = C;
        t = (1+sqrt(1+4*tpre^2))/2;
        C = W+(tpre-1)/t*(W-Cpre);
        tpre = t;
    end
    Y = msip.udhaarwtrec2(C,S);
    R = linproc(Y)-V;
    Cpre = C;
end
%%
%[text] ## 復元後の画像表示
figure(3) %[output:3827dc53]
imshow(Y) %[output:3827dc53]
title('復元画像') %[output:3827dc53]
%%
%[text] ## 復元後の品質
fprintf('復元後の品質(PSNR)： %6.2f dB\n',psnr(Y,X)) %[output:5b1d5bd1]
%%
%[text] ## 結果出力
imwrite(X,fullfile(resfolder,"fig01-04a.png"))
imwrite(V,fullfile(resfolder,"fig01-04b.png"))
imwrite(Y,fullfile(resfolder,"fig01-04c.png"))
%%
%[text] ## 関数定義
%[text] ソフト閾値処理
function y = softthresh(x,thresh)
    v = abs(x)-thresh;
    y = sign(x).*(v+abs(v))/2;
end

